
import { ByteUtils } from "kdbxweb";

export function toDataUrl (iconData: any) {
    return iconData ? "data:image/png;base64," + toBase64PNG(iconData) : null;
}

export function toBase64PNG (iconData: any): string|null {
    return iconData ? ByteUtils.bytesToBase64(iconData) : null;
}

export function mapStandardToBase64PNG (id: number = 0) {
    return iconMap[id];
}

export function fromDataUrl (dataUrl: string) {
    return dataUrl ? "data:image/png;base64," + fromBase64PNG(dataUrl.substr("data:image/png;base64,".length)) : null;
}

export function fromBase64PNG (base64Data: string) {
    return base64Data ? ByteUtils.base64ToBytes(base64Data) : null;
}

export function searchBase64PNGToStandard (dataUrl: string) {
    const index = iconMap.findIndex(val => val === dataUrl.substr("data:image/png;base64,".length));
    return index === -1 ? null : index;
}

